const config = {
  apiKey: process.env.local.NEXT_PUBLIC_API_KEY,
  authDomain: process.env.local.NEXT_PUBLIC_AUTH_DOMAIN,
  databaseURL: process.env.local.NEXT_PUBLIC_DB_URL,
  projectId: process.env.local.NEXT_PUBLIC_PROJECT_ID,
  storageBucket: process.env.local.NEXT_PUBLIC_STORAGE_BUCKET,
  messagingSenderId: process.env.local.NEXT_PUBLIC_MESSAGING_SENDER_ID,
  appId: process.env.local.NEXT_PUBLIC_APP_ID,
  measurementId: process.env.local.NEXT_PUBLIC_MEASUREMENT_ID
};

export default config;
